INSERT INTO `berita` (`kd_berita`, `judul_berita`, `isi_berita`, `tgl_update`, `gambar`, `kd_user`) VALUES
('BL191200001', 'Truk Barang Dilarang Lewat Tol saat Libur Natal dan Tahun Baru', 'Jakarta - Menteri Perhubungan (Menhub) Budi Karya Sumadi melakukan pembatasan operasional truk saat Natal 2019 dan Tahun Baru 2020 (Nataru). Pembatasan ini dilakukan di beberapa jalan tol dan jalan nasional termasuk tol Cikopo-Palimanan (Cipali).\r\n\r\nBudi Karya mengatakan, adanya truk dapat menghambat lajur kendaraan karena laju truk yang minim.\r\n\r\n\"Kami melakukan pembatasan operasional truk selama Nataru,\" katanya saat meninjau ruas tol Cipali di KM 102, Minggu (8/12/2019).\r\n\r\nLarangan operasional truk ditujukan untuk mobil barang dengan jumlah berat yang diizinkan (JBI) lebih dari 14.000 kg. Lalu, mobil barang dengan sumbu tiga atau lebih, hingga mobil barang dengan kereta tempelan atau kereta gandengan.\r\n\r\nSerta, mobil barang yang digunakan untuk mengangkut bahan galian meliputi tanah, pasir, batu, bahan tambang batu bara, bahan bahan bangunan meliputi besi/logam, semen dan kayu.\r\n\r\n\"Ini untuk angkutan berat dan non logistik ya. Kalau truk pengangkut logistik nggak masalah,\" jelasnya.\r\n\r\nPembatasan ini berlaku mulai puncak libur natal, yang diperkirakan jatuh pada tanggal 20-21 Desember 2019. Berikut rincian lengkapnya:\r\n\r\nA. Tanggal 21 Desember 2018 pukul 00.00 WIB hingga 22 Desember 2018 pukul 24.00 WIB:\r\n1. Berlaku 2 arah meliputi Tol Jakarta-Merak, Tol Prof Sedyatmo, Tol Lingkar Luar Jakarta, Tol Bawen-Salatiga, jalan nasional Medan-Brastagi Tanah Karo, jalan nasional Tegal-Purwokerto, jalan nasional Mojokerto-Taruban.\r\n2. Berlaku 1 arah meliputi Tol Jakarta Cikampek arah Cikampek, Tol Cikampek-Padalarang-Cileunyi arah Cileunyi, jalan nasional Pandaan-Malang arah Malang, jalan nasional Probolinggo-Lumajang arah Lumajang, dan jalan nasional Gilimanuk-Denpasar arah Denpasar.\r\n\r\nB. Tanggal 25 Desember 2018 mulai pukul 00.00 WIB hingga 24.00 WIB ruas Tol Jakarta-Cikampek arah ke Jakarta.\r\n\r\nC. Tanggal 28 Desember 2018 mulai pukul 00.00 WIB hingga 29 Desember 2018 pukul 24.00 WIB:\r\n1. Berlaku 2 arah meliputi Tol Jakarta-Merak, Tol Prof Sedyatmo, Tol Lingkar Luar Jakarta, Tol Bawen-Salatiga, jalan nasional Medan-Brastagi Tanah Karo, jalan nasional Tegal-Purwokerto, jalan nasional Mojokerto-Taruban.\r\n2. Berlaku 1 arah meliputi Tol Jakarta Cikampek arah Cikampek, Tol Cikampek-Padalarang-Cileunyi arah Cileunyi, jalan nasional Pandaan-Malang arah Malang, jalan nasional Probolinggo-Lumajang arah Lumajang, dan jalan nasional Gilimanuk-Denpasar arah Denpasar.\r\n\r\nD. Tanggal 1 Januari 2019 pukul 00.00 WIB sampai dengan pukul 24.00 WIB berlaku pada Tol Jakarta-Cikampek arah Jakarta dan jalan nasional Denpasar-Gilimanuk arah ke Gilimanuk.\r\n\r\n(Sumber : Detikom)', '2019-12-09', 'BL191200001.jpeg', 'USR01'),
('BL191200002', 'Angin Kencang di Ponorogo Geser Kubah Masjid Hingga Picu Macet 4 Km', 'Ponorogo - Hujan dan angin kencang yang terjadi di Ponorogo menyebabkan pohon tumbang di sepanjang jalan raya Ponorogo-Pacitan, tepatnya di jalan dari Kecamatan Balong hingga Kecamatan Slahung. Tumbangnya pohon itu membuat kemacetan sejauh 4 kilometer.\r\n\r\n\"Akibat pohon tumbang menyebabkan kemacetan sejauh 4 kilometer,\" ujar anggota Polsek Balong Bripka Sugianto kepada detikcom di lokasi, Sabtu (7/12/2019).\r\n\r\nPetugas dari kepolisian, TNI, BPBD, Rapi dibantu warga setempat melakukan pembersihan batang kayu dari jalan raya. Proses pembersihan dilakukan mulai pukul 15.00 hingga sekarang.\r\n\r\n\"Warga khawatir pohon banyak pohon yang miring, sehingga langsung ditebang demi keamanan,\" kata Sugianto.\r\n\r\nSugianto menambahkan pohon yang tumbang mengakibatkan beberapa truk besar tertahan karena tidak bisa melintas.\r\n\r\n\"Ini dibuka jalannya tapi dengan sistem buka tutup, karena banyak potongan batang pohon dipinggir jalan yang membahayakan pengendara,\" kata Sugianto.\r\n\r\nPantauan detikcom hingga saat ini proses pembersihan masih terus dilakukan oleh petugas dan warga menggunakan gergaji mesin dan alat seadanya.\r\n\r\n\"Ada beberapa pohon tua dan miring akan kami tebang,\" tandas Sugianto.\r\n\r\nSementara, Kabid Kedaruratan dan Logistik BPBD Ponorogo Setyo Budiono mengatakan akibat angin kencang ada kubah masjid yang bergeser.\r\n\r\n\"Lokasinya di Desa Bedi Kulon, Kecamatan Bungkal, kubah masjid bergeser sedikit. Untungnya tidak sampai jatuh,\" terang Budi sapaannya.\r\n\r\nData di BPBD Ponorogo, hujan disertai angin menyebabkan sejumlah pohon tumbang di tiga kecamatan yakni Balong, Bungkal, Slahung.\r\n\r\nRinciannya untuk Kecamatan Balong meliputi Desa Singkil, Desa Balong, Desa Ngumpul, Desa Ngraket, Desa Dadapan dan Desa Purworejo.\r\n\r\nKemudian, wilayah Kecamatan Bungkal meliputi Desa Bancar, Desa Bedi Wetan dan Desa Bedi Kulon. Sedangkan Desa Nailan di wilayah Kecamatan Slahung ada pohon tumbang menimpa pagar rumah warga dan kabel jaringan telkom.\r\n(iwd/iwd)\r\n(Sumber : Detikom)', '2019-12-10', 'BL191200002.jpeg', 'USR01'),
('BL191200003', 'Ditemani Istri, Anies Resmikan Pos Sahabat Perempuan-Anak di Stasiun MRT', 'Jakarta - Gubernur DKI Jakarta Anies Baswedan bersama istrinya, Fery Farhati Baswedan, meresmikan Pos Sahabat Perempuan dan Anak di stasiun MRT Dukuh Atas. Anies ingin menciptakan Jakarta yang ramah terhadap perempuan dan anak.\r\n\r\nDi pos tersebut terdapat ruang layanan untuk perempuan dan anak, termasuk pengecekan kesehatan. Disebutkan ada beberapa pos serupa di stasiun dan halte TransJakarta.\r\n\r\n\"Di TransJakarta ada 240 halte, lalu ada 6 stasiun LRT, dan ada 13 stasiun MRT. Di semua tempat itu, kami bangun pos sahabat perempuan dan anak,\" ucap Anies kepada wartawan di Stasiun Dukuh Atas, Jalan Sudirman, Jakarta Pusat, Selasa (10/12/2019).\r\n\r\nAnies mengatakan pentingnya membuat kota ramah perempuan dan anak. Indikator itu penting untuk membuat kota yang aman bagi semua kalangan.\r\n\r\n\"Kami menginginkan Jakarta menjadi kota yang ramah bagi perempuan dan anak. Bila kota ini ramah kepada perempuan dan anak, juga kepada lansia dan penyandang disabilitas, maka kota ini akan aman untuk semua,\" kata Anies.\r\n\r\nJakarta sedang membangun fasilitas transportasi umum. Sehingga, bagi Anies, perempuan dan anak harus diperhatikan.\r\n\"Nah ini semua harus didukung dengan suatu suasana di kendaraan umum yang nyaman, khususnya bagi kaum perempuan dan anak,\" kata Anies.\r\n\r\nAnies pun menyebut beberapa penghargaan kota ramah anak yang didapat Jakarta. Namun, dia tak hanya ingin sekedar penghargaan.\r\n\r\n\"Dari KPAI memberikan penghargaan sebagai kota ramah anak, dari Kementerian Perlindungan Perempuan dan Anak kami juga mendapatkan penghargaan. Yang kami ingin juga bukan hanya penghargaannya, tetapi juga perasaan yang ada di seluruh masyarakat. Itu yang ingin kami dorong,\" ucap Anies. (Sumber : Detikom)\r\n', '2019-12-10', 'BL191200003.jpeg', 'USR01'),
('BL191200004', 'Cek Rute Libur Akhir Tahun, Kakorlantas: Km 86-130 Cipali Rawan Kecelakaan', 'Cirebon - Kakorlantas Polri Irjen Istiono melakukan pengecekan jalur libur Natal dan tahun baru di sepanjang Tol Cipali, Jawa Barat. Istiono mengatakan fokus kepolisian lalu lintas adalah menekan angka kecelakaan, khususnya di Km 86-130 Tol Cipali.\r\n\r\n\"Kami fokuskan pertama kerawanan kecelakaan di Km 86-130. Ada satu langkah pencegahan di Km 130, ada rest area, kami wajibkan istirahat di sana. Kami tak ada alat pantau orang mengemudikan itu berapa jam, tapi kami lihat titik jenuh di Km 86-130. Melihat itu, kami proaktif mengingatkan mereka untuk istirahat,\" kata Istiono di Rest Area Tol Cipali Km 102, Jawa Barat, Senin (9/12/2019).\r\n\r\nstiono menuturkan pihak kepolisian akan \'memaksa\' pengendara beristirahat di rest area. Menurutnya, hal itu perlu dilakukan karena dalam setahun tercatat ada 22 kasus kecelakaan lalu lintas di sepanjang Km 86-130.\r\n\r\n\"Kalau merenggangkan dan kalau ngantuk, ya, tidur. Nanti akan kami paksa sedikit, karena data kami (Korlantas Polri), dalam setahun ini faktanya ada 22 kejadian (kecelakaan lalu lintas) di Cipali. Nanti ada warning di mobil double cabin kami, ada running text dan pengeras suara,\" jelas Istiono.\r\n(Sumber : Detikom)\r\n', '2019-12-10', 'BL191200004.jpeg', 'USR01'),
('BL191200005', 'Garuda Indonesia Bakal Gunakan Drone untuk Bisnis Kargo', 'Jakarta - PT Garuda Indonesia (Persero) Tbk akan menggunakan pesawat udara tanpa awak atau drone (unmaned aerial vehicle/UAV) dalam bisnis kargonya. Namun hal ini harus melalui masa uji coba terlebih dahulu.\r\n\r\nDirektur Kargo dan Pengembangan Bisnis Garuda, Mohammad Iqbal mengatakan uji coba akan dilakukan perdana di Aceh pada November mendatang.\r\n\r\nUji coba juga akan melibatkan Direktorat Kelaikidaraan dan Pengoperasian Pesawat Udara (DKUPPU).\r\n\r\n\"Kami akan trial selama 3 bulan dulu. Kami uji apa risikonya, apa sudah memenuhi kelayakan DKUPPU,‚Äù kata dia dalam diskusi bertajuk \'Menata Drone di Langit Ibu Pertiwi, di Hotel Morrisey, Jakarta, Selasa (22/10).\r\nDalam masa uji coba, drone akan mengangkut barang berkapasitas tidak lebih dari 500 kilogram dan dapat menjangkau jarak lebih-kurang 1.200 kilometer dengan kecepatan 300 kilometer per jam.\r\n\r\nSetelah Aceh, beberapa daerah lainnya yang akan dijadikan wilayah uji coba adalah wilayah Maluku, Maluku Utara, hingga Manado. Daerah-daerah tersebut dipilih sebab memiliki potensi Sumber Daya Alam seperti perikanan yang melimpah namun sulit dijangkau oleh angkutan logistik. Nantinya, drone akan mengangkut ikan hidup yang memiliki waktu maksimal 14 jam agar tetap segar.\r\n\r\nSetelah lolos uji coba, Garuda Indonesia akan menerbangkan pesawat tersebut untuk kepentingan komersial.\r\n\r\nDia mengungkapkan pada 2020, Garuda Indonesia setidaknya akan memiliki 10 unit drone untuk logistik yang akan diberi brand Frighter. Drone ini disebutkan akan mengangkut barang kebutuhan pokok hingga produk-produk e-commerce.\r\n\r\n\"Arahnya Garuda Indonesia ingin membangun sistem logistik mengantar barang dari Sabang sampai Merauke,\" ujarnya.\r\n\r\nSaat ini, lanjutnya, kebutuhan terhadap kargo atau pengiriman logistik semakin tinggi. Menurut dia, kebutuhan terhadap angkutan kargo melonjak 11 persen per tahun. Pertumbuhan pengiriman barang e-commerce tercatat paling tinggi dengan peningkatan volume lebih dari 50 persen per tahun.\r\n\r\n(Sumber : Liputan6.com)', '2019-12-10', 'BL191200005.webp', 'USR01');
